Pomarine Jaeger:
- has 18 white tail feathers with broad black bars;
- has a slender body;
- has a small head and bill;
- has dark grey upperparts;
- has white underparts;
- has a black cap.

Blue-winged Warbler:
- males are blue-gray with a yellow breast and black-and-white wings;
- females are olive-green with yellow underparts and gray wings;
- both sexes have a white eye-ring.
